Helen McNicol is een knap schoolmeisje. Ze is tot over haar oren verliefd op haar vriendje Stan. Jammer genoeg komt ze erachter dat haar vriend haar gebruikt om in het &quot;bang book&quot; van de school te komen. In het ''bang book'' staat een lijst die is bijgehouden door de jongens van het voetbalteam, waarin hun seksuele veroveringen worden doorgegeven. Helen staat dit niet toe en besluit samen met enkele andere meiden wraak te nemen.

